import { useContext } from 'react'
import { UserContext } from '../contexts/userContext'
import '../styles/tailwind.css'
import SideNav from '../components/SideNav'
import CenterPane from '../components/CenterPane'
import Profile from '../components/Profile'
export default () => {
    const { userID, storeUserID } = useContext(UserContext)
    storeUserID(1)
    console.log(userID)
    const gridType = userID ? 'mobileHome sm:grid-cols-home' : 'profile sm:grid-cols-profile'
    const grid = `grid grid-cols-${gridType} grid-rows-1 h-screen overflow-y-hidden`
    return(
        <div className={grid}>
            <SideNav />
            <CenterPane />
            {userID != false ? <Profile /> : null}
        </div>
    )
}
